import React from 'react';
import {Link} from 'react-router-dom';

function NavigationBar() {
  return(
    <nav className="navbar navbar-dark bg-primary fixed-right">
      <Link className="navbar-brand" to="https://app.mobalytics.gg/summoner-search">Home</Link>
      <Link className="navbar-brand" to="https://en.wikipedia.org/wiki/React_(web_framework)">Ect</Link>
    </nav>
  )
}

export default NavigationBar;
